INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100101, "獣人族", 0, 2, "ヒヨリ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "東山奈央", "人助け、応援", 155, 8, "A", 16, "人助けが大好き！　前向き格闘娘", 44, "トゥインクルウィッシュ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100201, "ヒューマン", 0, 2, "ユイ", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "種田梨沙", "料理、人間観察", 158, 4, "O", 17, "戦闘のサポートが得意な、心優しい少女", 47, "トゥインクルウィッシュ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100301, "魔族", 0, 2, "レイ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "早見沙織", "読書、乗馬、お茶", 163, 1, "B", 18, "クールで何事にも真っ直ぐな剣士", 46, "トゥインクルウィッシュ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100401, "ヒューマン", 0, 5, "ミソギ", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, "諸星すみれ", "いたずら、探検", 128, 8, "O", 9, "探検好きのイタズラっ子", 27, "リトルリリカル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100501, "獣人族", 0, 8, "マツリ", "？？？", 25, "下田麻美", "ヒーローごっこ", 146, 11, "O", 12, "ヒーローに憧れる騎士見習いの少女", 40, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100601, "魔族", 0, 7, "アカリ", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, "浅倉杏美", "サックス", 150, 11, "O", 13, "甘え上手なみんなの人気者", 42, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100701, "魔族", 0, 7, "ミヤコ", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "雨宮天", "プリンを食べること", 130, 1, "B", 14, "プリン大好きゴースト娘", 32, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100801, "エルフ", 0, 15, "ユキ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "大空直美", "鏡で自分を見ること", 150, 10, "AB", 14, "ボクは誰よりも美しい", 40, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100901, "魔族", 0, 13, "アンナ", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, "髙野麻美", "小説執筆", 159, 7, "A", 17, "前世を信じる中二病患者、「疾風の冥姫」", 45, "トワイライトキャラバン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101001, "獣人族", 0, 10, "マホ", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "内田真礼", "空想、ぬいぐるみ集め", 155, 9, "O", 16, "マホマホ王国のプリンセス", 42, "自警団（カォン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101101, "ヒューマン", 0, 3, "リノ", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, "阿澄佳奈", "お裁縫", 156, 8, "A", 15, "人懐っこくてマシンガントークな妹系少女", 44, "ラビリンス");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101201, "エルフ", 0, 6, "ハツネ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, "大橋彩香", "妹と遊ぶこと、二度寝、昼寝、早寝", 156, 12, "A", 17, "みんなのために超能力を使う眠り姫", 46, "フォレスティエ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101301, "魔族", 0, 13, "ナナカ", "", 21, "佳村はるか", "読書、魔法", 166, 8, "O", 18, "オタク全開な魔法少女", 55, "トワイライトキャラバン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101401, "獣人族", 0, 10, "カスミ", "test", 3, "水瀬いのり", "読書、推理", 152, 11, "AB", 15, "頭脳明晰な美少女名探偵", 41, "自警団（カォン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101501, "エルフ", 0, 6, "ミサト", "test", 5, "國府田マリ子", "絵本作り", 165, 9, "O", 21, "母性溢れる優しいみんなの「ミサト先生」", 54, "フォレスティエ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101601, "魔族", 0, 14, "スズナ", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "上坂すみれ", "ファッション", 167, 4, "O", 18, "天真爛漫で人気者のカリスマモデル", 48, "ルーセント学院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101701, "獣人族", 0, 10, "カオリ", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "高森奈津美", "踊り、空手", 158, 7, "A", 19, "いつでも「なんくるないさ～」な天然娘", 53, "自警団（カォン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (101801, "魔族", 0, 14, "イオ", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "伊藤静", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 162, 8, "B", 23, "多くの男性を魅了する無垢な女教師", 52, "ルーセント学院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102001, "獣人族", 0, 5, "ミミ", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "日高里菜", "かわいいもの集め", 117, 4, "O", 10, "お歌もにんじんも、ウサギさんも大好き♪", 21, "リトルリリカル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102101, "ヒューマン", 0, 9, "クルミ", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "植田佳奈", "観劇、おままごと", 150, 6, "B", 12, "泣き虫で臆病な守ってあげたい女の子", 40, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102201, "魔族", 0, 7, "ヨリ", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, "原紗友里", "ゲーム全般", 150, 11, "O", 13, "人見知りであまのじゃくな女の子", 40, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102301, "ヒューマン", 0, 9, "アヤネ", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "芹澤優", "屋内でできる遊び", 148, 5, "B", 14, "ぷうきちといつも一緒！", 38, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102501, "ヒューマン", 0, 9, "スズメ", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "悠木碧", "ご奉仕", 154, 12, "O", 15, "お嬢さまのためにがんばるドジっ娘メイド", 43, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102601, "獣人族", 0, 11, "リン", "test", 1, "小岩井ことり", "あんパン", 144, 1, "B", 17, "遊びと睡眠が何より大事なぐうたら娘", 42, "牧場（エリザベスパーク）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102701, "魔族", 0, 13, "エリコ", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "橋本ちなみ", "実験、裁縫、料理", 154, 7, "B", 16, "運命の相手に一途すぎる乙女", 43, "トワイライトキャラバン");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102801, "エルフ", 0, 9, "サレン", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "堀江由衣", "経営、お茶会", 156, 10, "A", 17, "救護院を経営する優しい庶民派お嬢様", 43, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102901, "ヒューマン", 0, 4, "ノゾミ", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 24, "日笠陽子", "舞台鑑賞、ダンス", 157, 1, "B", 17, "歌って踊れる大人気アイドル", 40, "カルミナ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103001, "ヒューマン", 0, 15, "ニノン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "佐藤聡美", "忍法開発", 163, 8, "O", 16, "トーゴクの神秘、オシエテクダサイ！", 51, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103101, "魔族", 0, 7, "シノブ", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "大坪由佳", "占い", 157, 12, "AB", 18, "占いが得意な霊能少女", 42, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103201, "ヒューマン", 0, 12, "アキノ", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "松嵜麗", "慈善事業", 157, 3, "AB", 18, "一人前の商人を目指すパワフルお嬢様", 45, "メルクリウス財団");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103301, "ヒューマン", 0, 11, "マヒル", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "新田恵海", "漫才", 142, 3, "B", 20, "みんなを笑顔にするお笑い牧場主", 35, "牧場（エリザベスパーク）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103401, "エルフ", 0, 12, "ユカリ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "今井麻美", "ウインドーショッピング", 164, 3, "A", 22, "純情でほっとけない大人の女性", 55, "メルクリウス財団");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103601, "エルフ", 0, 5, "キョウカ", "test", 2, "小倉唯", "お勉強", 118, 2, "A", 8, "礼儀正しくしっかり者のちびっ子優等生", 21, "リトルリリカル");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103701, "ヒューマン", 0, 8, "トモ", "test", 11, "茅原実里", "剣術、年長者をからかう", 149, 8, "A", 13, "義理堅くてからかい好きな剣術少女", 43, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (103801, "獣人族", 0, 11, "シオリ", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, "小清水亜美", "読書、お散歩", 153, 11, "A", 14, "読書が趣味の病弱少女", 40, "牧場（エリザベスパーク）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104001, "エルフ", 0, 6, "アオイ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "花澤香菜", "友達作りのイメトレ", 158, 6, "AB", 13, "「友達」に憧れる、エルフの森の女の子", 44, "フォレスティエ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104201, "ヒューマン", 0, 4, "チカ", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "福原綾香", "各種楽器", 163, 6, "O", 17, "人々を守るために歌う、唱喚士の少女", 46, "カルミナ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104301, "獣人族", 0, 10, "マコト", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, "小松未可子", "お菓子作り", 168, 8, "O", 17, "男勝りで情に厚いワイルド娘", 54, "自警団（カォン）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104401, "魔族", 0, 7, "イリヤ", "test", 5, "丹下桜", "世界征服", 172, 5, "A", "??", "かつては夜を支配した最強の吸血鬼", 50, "悪魔偽王国軍（ディアボロス）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104501, "ヒューマン", 0, 15, "クウカ", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "長妻樹里", "小説を読むこと", 157, 11, "AB", 18, "妄想大好き！　ほんとは照れ屋な女の子", 49, "ヴァイスフリューゲル　ランドソル支部");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104601, "獣人族", 0, 12, "タマキ", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "沼倉愛美", "猫とたわむれること", 158, 3, "AB", 18, "弱きを助け強きをくじく猫娘", 48, "メルクリウス財団");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104701, "ヒューマン", 0, 8, "ジュン", "？？？", 25, "川澄綾子", "格闘技、湯浴み", 171, 10, "A", 25, "素顔を見せない冷静沈着な女性騎士", 50, "王宮騎士団（NIGHTMARE）");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (104801, "ヒューマン", 0, 12, "ミフユ", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "田所あずさ", "傭兵などのアルバイト", 163, 11, "O", 20, "仕事も私事も効率優先な傭兵少女", 49, "メルクリウス財団");
