INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108301, "魔族", 0, 14, "ミサキ（ハロウィン）", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "久野美咲", "ファッション誌鑑賞、コスメ集め", 120, 1, "A", 11, "ちょっとおませな恋に恋する女の子", 22, "ルーセント学院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108401, "ヒューマン", 0, 4, "チカ（クリスマス）", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "福原綾香", "各種楽器", 163, 6, "O", 17, "人々を守るために歌う、唱喚士の少女", 46, "カルミナ");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108501, "ヒューマン", 0, 9, "クルミ（クリスマス）", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "植田佳奈", "観劇、おままごと", 150, 6, "B", 12, "泣き虫で臆病な守ってあげたい女の子", 40, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108601, "ヒューマン", 0, 9, "アヤネ（クリスマス）", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "芹澤優", "屋内でできる遊び", 148, 5, "B", 14, "ぷうきちといつも一緒！", 38, "サレンディア救護院");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108701, "獣人族", 0, 2, "ヒヨリ（ニューイヤー）", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "東山奈央", "人助け、応援", 155, 8, "A", 16, "人助けが大好き！　前向き格闘娘", 44, "トゥインクルウィッシュ");
