INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109201, "ヒューマン", 0, "", "アン", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 1, "日笠陽子", "読書", 156, 12, "AB", 17, "英霊と契約を結んだマナリアの天才王女", 55, "？？？");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109301, "ヒューマン", 0, "", "ルゥ", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 4, "こやまきみこ", "食べること、眠ること", 144, 2, "O", 15, "マナリア魔法学院の新入生", 45, "？？？");
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109401, "半人半竜", 0, "", "グレア", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 3, "福原綾香", "ピアノ", 167, 11, "B", 17, "人を超越した力を有す心優しい竜姫", 67, "？？？");
